import FetchService from "./fetchService";
const API = "http://localhost:5000";
class BoardService extends FetchService {

  async create_board(body) {
    const options = this.createOption("POST", body);
    const response = await this.fetchData(API + "/Health-Website/create_board", options);
    return response;
  }

  async update_all_choosen_state(body) {
    const options = this.createOption("POST", body);
    const response = await this.fetchData( API + "/Health-Website/update_all_choosen_state", options);
    return response
  }

  async update_choosen_state(body) {
    const options = this.createOption("POST", body);
    const response = await this.fetchData( API + "/Health-Website/update_choosen_state", options);
    return response
    }
}

export default new BoardService();
